INSERT INTO `ps_translation` VALUES (1,2,'Review this credit slip and download it on our shop, go to the <a href=\"{order_slip_url}\" target=\"_blank\">%credit_slips_label%</a> section of your customer account.','Przejrzyj tę kartę kredytową i pobierz ją w naszym sklepie, przejdź do <a href=\"{order_slip_url}\" target=\"_blank\">%credit_slips_label%</a> w sekcji konta klienta','EmailsBody',NULL),(3,2,'Reassure your customers, display a short notice to let them know you care about privacy.','Uspokój swoich klientów, wyświetl krótkie powiadomienie, aby dać im znać, że dbasz o prywatność.','ModulesDataprivacyAdmin',NULL),(4,2,'The personal data you provide is used to answer queries, process orders or allow access to specific information. You have the right to modify and delete all the personal information found in the \"My Account\" page.','Udostępnione przez Ciebie dane osobowe są wykorzystywane w celu udzielania odpowiedzi na zapytania, przetwarzania zamówień lub umożliwiania dostępu do konkretnych informacji. Przysługuje Ci prawo do modyfikowania oraz usuwania wszelkich danych osobowych zamieszczonych na stronie „Moje konto”.','ModulesDataprivacyAdmin',NULL);
